import { Component } from '@angular/core';
import { Cat } from './cat';

@Component({
  selector: 'app-cat-table',
  templateUrl: './cat-table.component.html',
  styleUrls: ['./cat-table.component.css']
})
export class CatTableComponent {

    catList: Cat[] = [
      {
        name: 'Whiskers',
        breed: 'Siamese',
        age: 3,
        vaccination: true,
        lastVetVisit: new Date(2023, 6, 20),
      },
      {
        name: 'Paws',
        breed: 'Maine Coon',
        age: 5,
        color: 'brown',
        vaccination: false,
        lastVetVisit: new Date(2023, 7, 15),
      },
      {
        name: 'Shadow',
        breed: 'Russian Blue',
        age: 2,
        color: 'blue',
        vaccination: true,
        lastVetVisit: new Date(2023, 5, 10),
      },
      {
        name: 'Simba',
        breed: 'Bengal',
        age: 4,
        color: 'golden',
        vaccination: true,
        lastVetVisit: new Date(2023, 8, 22),
      }
    ]
}
